def find_adjacent(left, line):


    # find the next non zero index for left
    while left < (len(line) - 1) and line[left] == 0:
        left += 1

    right = left + 1
    # find the next non zero index after left
    while right < len(line) and line[right] == 0:
        right += 1

    return left, right

