def unit_mapping(unit,kern):

    if unit == 1: 
        mapping = {"shortcut":0,
                   "conv1":1,
                   "conv2":2,
                   "conv3":3}
    else:    
        offset = 4+3*(unit-2) # offset by 4 for the first unit, plus 3 for every additional unit. 
        mapping = {"conv1":0+offset,
                   "conv2":1+offset,
                   "conv3":2+offset}
    return mapping[kern]+1

