def discrete_ranges(values, succ=lambda x: x + 1):

    ranges = []
    last = None
    for x in sorted(values):
        if last is None:
            start = last = x
        else:
            if x == succ(last):
                last = x
            else:
                ranges.append((start, last))
                last = None
    if last is not None:
        ranges.append((start, last))

    return ranges

