def _bounds_side(size, max_pixels, overlap, coord, axis):

    pixels = max_pixels[axis]
    start = coord[axis] * pixels
    end = start + pixels
    if overlap is not None:
        end += overlap[axis]
    if end > size[axis]:
        end = size[axis]
    return int(start), int(end)

