def height_of_beam_after_dx(d1, d2, L12, distance):


    alpha = (d1 + d2) / 2.0 / L12
    beta = abs(d1 - d2) / 2.0 / L12
    if distance >= 0:
        return (beta * distance * 2) + d2, (alpha * distance * 2) + d2
    else:
        return (
            (beta * abs(distance) * 2) + d1,
