def _mem_unitconv(mem, units="MB"):

    if units.lower() == "b":
        return mem
    elif units.lower() == "kb":
        denom = 1024.0
    elif units.lower() == "mb":
        denom = 1024 * 1024.0
    elif units.lower() == "gb":
        denom = 1024 * 1024 * 1024.0
    else:
        raise ValueError(
            "units must be B, KB, MB or GB. (corresponding to "
            "bytes, kilobytes, megabytes, gigabytes)"
        )
    return mem / denom

